import{_ as e,c as i,o as t,d as a}from"./app.590c1fbf.js";const _=JSON.parse('{"title":"Git 导航","description":"","frontmatter":{},"headers":[{"level":2,"title":"Git 是什么","slug":"git-是什么","link":"#git-是什么","children":[]},{"level":2,"title":"Git 相关知识点","slug":"git-相关知识点","link":"#git-相关知识点","children":[{"level":3,"title":"四大工作区域","slug":"四大工作区域","link":"#四大工作区域","children":[]},{"level":3,"title":"工作流程","slug":"工作流程","link":"#工作流程","children":[]},{"level":3,"title":"四种状态","slug":"四种状态","link":"#四种状态","children":[]},{"level":3,"title":"图解工作流程","slug":"图解工作流程","link":"#图解工作流程","children":[]}]},{"level":2,"title":"Git学习平台","slug":"git学习平台","link":"#git学习平台","children":[]},{"level":2,"title":"参考资料","slug":"参考资料","link":"#参考资料","children":[]}],"relativePath":"Git/index.md"}'),l={name:"Git/index.md"},r=a('<h1 id="git-导航" tabindex="-1">Git 导航 <a class="header-anchor" href="#git-导航" aria-hidden="true">#</a></h1><h2 id="git-是什么" tabindex="-1">Git 是什么 <a class="header-anchor" href="#git-是什么" aria-hidden="true">#</a></h2><ul><li>分布式版本控制系统</li><li>与之对应的：集中化版本控制系统 <ul><li>缺点，集中在中央服务器上，如果断电等原因，就找不到资源</li><li>代表 SVN</li><li>集中化版本控制的缺点就是分布式斑斑控制的有点</li></ul></li><li>Git 是免费、开源的分布式版本控制系统</li></ul><h2 id="git-相关知识点" tabindex="-1">Git 相关知识点 <a class="header-anchor" href="#git-相关知识点" aria-hidden="true">#</a></h2><p>四大工作区域</p><p>工作流程</p><p>四种状态</p><p>图解工作流程</p><h3 id="四大工作区域" tabindex="-1">四大工作区域 <a class="header-anchor" href="#四大工作区域" aria-hidden="true">#</a></h3><p><img src="https://s2.loli.net/2022/06/02/PFnpm6MtG8LEeNV.png" alt="Git工作区"></p><ul><li><p>Workspace（工作区）：本地电脑所见的文件和目录</p></li><li><p>Index/Stage（暂存区）：一般存放在 <code>.git</code> 目录下，当你 <code>git add 改动文件</code>，改动的文件就放入在「暂存区」</p></li><li><p>Respository（本地仓库）：当你 <code>git clone 地址</code>，就将远程仓库克隆到本地仓库。它是存在本地的版本库，其中HEAD指向最新放入仓库的版本。当你执行 <code>git commit</code>，文件改动就到本地仓库</p></li><li><p>Remote（远程仓库）：类似Github、Gitlab、码云等放在代码托管平台</p></li></ul><h3 id="工作流程" tabindex="-1">工作流程 <a class="header-anchor" href="#工作流程" aria-hidden="true">#</a></h3><p>一图解释常规的 Git 工作流程</p><p><img src="https://s2.loli.net/2022/06/02/yEnIeOKRFA1Ldct.png" alt="image-20220602140735939"></p><p>简单解释：</p><ul><li>从远程仓库拉去代码，<code>git clone XXX</code></li><li>在工作目录，增删改查文件，</li><li>将改动文件放入暂存区，<code>git add 需要提交的文件</code></li><li>将暂存区的文件提交本地仓库，<code>git commit - &quot;描述&quot;</code></li><li>获取远程仓库最新的代码，<code>git pull origin master</code></li><li>将本地仓库的文件推送至远程仓库，<code>git push origin master</code></li></ul><p>而比较复杂的可以看这篇——<a href="./git工作流程.html">git工作流程</a></p><h3 id="四种状态" tabindex="-1">四种状态 <a class="header-anchor" href="#四种状态" aria-hidden="true">#</a></h3><h3 id="图解工作流程" tabindex="-1">图解工作流程 <a class="header-anchor" href="#图解工作流程" aria-hidden="true">#</a></h3><h2 id="git学习平台" tabindex="-1">Git学习平台 <a class="header-anchor" href="#git学习平台" aria-hidden="true">#</a></h2><p>在线学习git：<a href="https://learngitbranching.js.org/?locale=zh_CN" target="_blank" rel="noreferrer">learngitbranching</a></p><h2 id="参考资料" tabindex="-1">参考资料 <a class="header-anchor" href="#参考资料" aria-hidden="true">#</a></h2><ul><li><p><a href="https://mp.weixin.qq.com/s?__biz=Mzk0MzIyMDA1OA==&amp;mid=2247494230&amp;idx=4&amp;sn=44a9a3f11382f748f6aede13ab644d7a&amp;source=41#wechat_redirect" target="_blank" rel="noreferrer">程序员必备基础：Git 命令全方位学习</a></p></li><li><p><a href="https://www.zhihu.com/question/357385506" target="_blank" rel="noreferrer">如何学习好 Git ？知乎讨论</a></p></li><li><p><a href="https://mp.weixin.qq.com/s/7eLcoFTHwMETH-Sqb4ysKg" target="_blank" rel="noreferrer">图解 Git 各种用法，简单明了，一目了然！</a></p></li><li><p><a href="https://mp.weixin.qq.com/s?__biz=Mzk0MzIyMDA1OA==&amp;mid=2247494230&amp;idx=4&amp;sn=44a9a3f11382f748f6aede13ab644d7a&amp;source=41#wechat_redirect" target="_blank" rel="noreferrer">程序员必备基础：Git 命令全方位学习</a></p></li></ul>',23),d=[r];function n(h,c,o,s,p,g){return t(),i("div",null,d)}const m=e(l,[["render",n]]);export{_ as __pageData,m as default};
